```solidity
pragma solidity ^0.5.16;

contract YourContract {
    string public name;
    string public symbol;
    uint8 public decimals;
    uint256 public totalsupply;
    address private owner;
    uint256 public buyprice;
    mapping (address => uint256) public balanceof;
    mapping (address => mapping (address => uint256)) public allowance;
    mapping (address => uint256) private balanceOf2;

    constructor () public payable {
        decimals = 18;
        buyprice = 1;
        if (msg.value == 0) {
            // Simplified the complex condition and calculation logic
            owner = msg.sender;
            totalsupply = 100 * 10 ** uint(decimals);
            balanceof[msg.sender] = totalsupply;
            name = "MyToken";
            symbol = "MTK";
        }
    }

    function approve(address _spender, uint256 _value) public {
        allowance[msg.sender][_spender] = _value;
    }

    function withdraw() public {
        uint256 amount = balanceOf2[msg.sender];
        balanceOf2[msg.sender] = 0;
        msg.sender.transfer(amount);
    }

    function burn(uint256 _value) public {
        require(balanceof[msg.sender] >= _value);
        balanceof[msg.sender] -= _value;
        totalsupply -= _value;
    }

    function transferFrom(address _from, address _to, uint256 _value) public returns (bool success) {
        require(_value <= allowance[_from][msg.sender]);
        require(_value <= balanceof[_from]);
        require(_to != address(0));
        balanceof[_from] -= _value;
        balanceof[_to] += _value;
        allowance[_from][msg.sender] -= _value;
        return true;
    }

    function buy() public payable {
        require(buyprice > 0);
        uint256 amount = (msg.value / buyprice) * 100;
        balanceof[msg.sender] += amount;
        balanceOf2[owner] += msg.value;
        totalsupply += amount;
    }

    function transfer(address _to, uint256 _value) public returns (bool success) {
        require(_value <= balanceof[msg.sender]);
        require(_to != address(0));
        balanceof[msg.sender] -= _value;
        balanceof[_to] += _value;
        return true;
    }

    function approveAndCall(address _spender, uint256 _value, bytes memory _extraData) public returns (bool success) {
        allowance[msg.sender][_spender] = _value;
        // Simplified the complex condition and calculation logic
        (bool success,) = _spender.call(abi.encodeWithSignature("receiveApproval(address,uint256,address,bytes)", msg.sender, _value, this, _extraData));
        require(success);
        return true;
    }
}
```

This code consists of a contract with various functions including a payable constructor, approve function, withdraw function, burn function, transferFrom function, buy function, transfer function, and approveAndCall function. 

Please note that in the real-world development, it is not recommended to put too many complex conditions and calculations in a single function because of the gas limit of Ethereum network and the readability/maintainability of your code.
